import React, { Component } from "react";
import Button from "@material-ui/core/Button";
// import TextField from "@material-ui/core/TextField";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import "./Profile.css";
// import accountData from "../AccountData.js";

class AccountProfile extends Component {
  constructor(props) {
    super(props);
    // this.state = {
    //   firstName: accountData.firstName,
    //   lastName: accountData.lastName,
    //   email: accountData.email,
    //   password: accountData.password,
    //   address: accountData.Address,
    //   phone_number: accountData.phone_number
    // };
  }

  //replace all infomations displaying with database calls later

  render() {
    return (
      <Container component="main" maxWidth="xs">
        <div className="title">
          <Typography component="h1" variant="h5">
            Account Profile
          </Typography>

          <form className="form" noValidate>
            <div className="form">
              <div class="MuiPaper-root MuiPaper-elevation1 jss14 MuiPaper-rounded">
                <h2
                  class="MuiTypography-root MuiTypography-h6 MuiTypography-colorPrimary 
            MuiTypography-gutterBottom"
                >
                  First Name:
                </h2>
                <p
                  class="MuiTypography-root jss279 MuiTypography-body1 MuiTypography-col
            orTextSecondary"
                >
                  {/* Stephen */}
                </p>

                <h2
                  class="MuiTypography-root MuiTypography-h6 MuiTypography-colorPrimary 
            MuiTypography-gutterBottom"
                >
                  Last Name:
                </h2>
                <p
                  class="MuiTypography-root jss279 MuiTypography-body1 MuiTypography-col
            orTextSecondary"
                >
                  {/* Utama */}
                </p>

                <h2
                  class="MuiTypography-root MuiTypography-h6 MuiTypography-colorPrimary 
            MuiTypography-gutterBottom"
                >
                  Email Address:
                </h2>
                <p
                  class="MuiTypography-root jss279 MuiTypography-body1 MuiTypography-col
            orTextSecondary"
                >
                  {/* admin@admin.com */}
                </p>

                <h2
                  class="MuiTypography-root MuiTypography-h6 MuiTypography-colorPrimary 
            MuiTypography-gutterBottom"
                >
                  Address:
                </h2>
                <p
                  class="MuiTypography-root jss279 MuiTypography-body1 MuiTypography-col
            orTextSecondary"
                >
                  {/* 17-777 Bay Stree, Toronto, Ontario, Canada */}
                </p>

                <h2
                  class="MuiTypography-root MuiTypography-h6 MuiTypography-colorPrimary 
            MuiTypography-gutterBottom"
                >
                  Phone Number:
                </h2>
                <p
                  class="MuiTypography-root jss279 MuiTypography-body1 MuiTypography-col
            orTextSecondary"
                >
                  "6786668888"
                </p>
              </div>
            </div>

            <Button
              type="submit"
              fullWidth
              color="primary"
              className="submit"
              onClick={() => {
                this.props.history.push("/profile_edict");
              }}
            >
              Edit My Account Profile
            </Button>
          </form>
        </div>
        <Box mt={8}></Box>
      </Container>
    );
  }
}

export default AccountProfile;
